import { makeStyles } from "@material-ui/core";

const APP_BAR = 64;

export default makeStyles({
  flex: {
    display: "flex",
  },

  sidebar: {
    paddingTop: APP_BAR,
  },

  main: {
    paddingTop: APP_BAR + 30,
  },
});
